import logo from './logo.svg';
import './App.css';
import React from "react";

function App() {

  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("localhost:4000/")
        .then((res) => res.json())
        .then((data) => setData(data.message));
  }, []);



  return (
      <div className="App">
        <header className="App-header">
            <p>{data}</p>
        </header>
      </div>
  );
}

export default App;
